import Logo from "../images/plogo.png";
import ResumeIcon from "../images/icons8-resume-50.png";
import worksIcon from "../images/icons8-document-30.png";
import aboutIcon from "../images/icons8-contact-50.png";
import mailIcon from "../images/icons8-mail-50.png";
import lightNdarkModeIcon from "../images/icons8-dark-mode-50.png";

const Nav = () => {
	return (
		<nav className="w-full px-7 py-5 text-gray-600 flex items-center justify-between">
			<div className="flex items-center justify-between w-1/3">
				<div className="pl-4">
					<img
						src={Logo}
						alt=""
						width={30}
					/>
				</div>
				<div className="flex gap-1 items-center font-semibold cursor-pointer hover:text-orange-500">
					<img
						src={mailIcon}
						alt=""
						width={20}
						height={20}
					/>
					<a
						href="mailto:nuelorji98@gmail.com"
						rel="noopener"
						target="_blank"
					>
						nuelorji98@gmail.com
					</a>
				</div>
				<div className="cursor-pointer">
					<img
						src={lightNdarkModeIcon}
						alt=""
						width={25}
						height={25}
					/>
				</div>
			</div>

			<div className="w-1/3 flex justify-evenly cursor-pointer">
				<div className="flex gap-1 items-center">
					<img
						src={worksIcon}
						alt=""
						width={20}
						height={20}
					/>
					<span>Works</span>
				</div>

				<div className="flex gap-1 items-center cursor-pointer">
					<img
						src={ResumeIcon}
						alt=""
						width={20}
						height={20}
					/>
					<span>Resume</span>
				</div>
				<div className="flex gap-1 items-center cursor-pointer">
					<img
						src={aboutIcon}
						alt=""
						width={20}
						height={20}
					/>
					<span>About</span>
				</div>
			</div>
		</nav>
	);
};

export default Nav;
